import React, { useState } from "react";
import axios from "axios";
import "../sass/ListToDo/todolist.css";
import img_box from "../img/d/profil.png";
import box_chat from "../img/box-chat/db-main-small.png";
import knife from "../img/box-chat/knife.png";
import phone_img from "../img/box-chat/phone-img.png";
import take_img from "../img/box-chat/take-ur-time.png";

const ListToDo = () => {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");

  const fetchData = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        "http://localhost:3001/api/create-list",
        {
          title,
          description,
        },
        {
          withCredentials: true,
        }
      );
      console.log(res);
      if (res === 201) {
        console.log("Succesfull");
      }
    } catch (err) {
      console.log(err);
    }
  };
  return (
    <div className="bg_list">
      <div className="box_todo_list">
        <svg className="phone-svg">
          <polygon points="10,0 300,0 290,100 290,310 5,310" />
        </svg>
        <svg className="screen-border-svg1">
          <polygon points="20,10 280,10 280,350 250,300 20,300" />
        </svg>
        {/* <svg className="screen-border-svg2">
          <polygon points="25,10 275,10 270,300 290,410 15,200" />
        </svg> */}

        {/* <img className="phone-img" src={phone_img} alt="" />
        <img
          className="take-img"
          src={take_img}
          alt=""
          onDragStart={function () {
            return false;
          }}
        /> */}
      </div>

      <div className="title-list">
        <div className="todolist">
          <span className="lettering-under">ToDoList</span>
          <span className="lettering">
            <span className="color">T</span>odo
            <span className="color">L</span>ist
          </span>
        </div>
        <svg className="zig-shadow">
          <polygon points="70,80 60,160  110,220  80,280  120,180  70,215  15,160" />
        </svg>
        <svg className="zig">
          <polygon points="70,80 80,80  60,160  110,220  80,280  120,180  70,215  15,160" />
        </svg>
        <div className="todo">
          <div className="profil">
            <svg className="borders-shadow">
              <polygon points="6,10 80,20 110,70 20,92" />
            </svg>
            <svg className="borders">
              <polygon points="0,10 80,20 110,75 20,95" />
            </svg>
            <svg className="outlines">
              <polygon points="10,10 80,13 110,63 25,80" />
            </svg>
            <svg className="outlines">
              <polygon points="10,10 80,13 110,63 25,80" />
            </svg>
            <img className="img-imagine" src={img_box} width={100} alt="" />
            <form onSubmit={fetchData}>
              <div className="text-container">
                <img className="text-box" src={box_chat} alt="" />
                <input
                  value={title}
                  onChange={(e) => {
                    setTitle(e.target.value);
                  }}
                  className="text-input1"
                  type="text"
                  placeholder="title"
                />
                <textarea
                  value={description}
                  onChange={(e) => {
                    setDescription(e.target.value);
                  }}
                  className="text-input2"
                  placeholder="your List"
                />
              </div>
              <div className="wrap-btn">
                <input className="submit" type="submit" id="bg-back" />
                <img className="knfu-img" src={knife} alt="" />
              </div>
            </form>
            <svg className="zig-shadow">
              <polygon points="100,85  120,80  55,160  110,230  80,290  50,280  70,205  -1,160" />
            </svg>
            <svg className="zig">
              <polygon points="100,85  130,80  55,160  110,230  80,290  50,280  70,205  -1,160" />
            </svg>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ListToDo;
